In an ideal world, what we would have loved is writing the following code: struct MyProcessor
{ static consteval auto name() { return "Addition"; } struct { float a; float b; } inputs; struct { float out; } outputs; void operator()() { outputs.out = inputs.a + inputs.b; }
}; and have our Python processor expose us variables named a, b and out. Sadly, without reflection on names, this is not possible yet. Thus, in the meantime we use structs to embed metadata relative to the ports: struct MyProcessor
{ static consteval auto name() { return "Addition"; } struct { struct { static consteval auto name() { return "a"; } float value; } a; struct { static consteval auto name() { return "b"; } float value; } b; } inputs; struct { struct { static consteval auto name() { return "out"; } float value; } out; } outputs; void operator()() { outputs.out.value = inputs.a.value + inputs.b.value; }
}; Now our Python example is cleaner to use: >>> import pymy_processor
>>> proc = pymy_processor.Addition()
>>> proc.process()
>>> p.a = 123
>>> p.b = 456
>>> p.process()
>>> p.out
579.0

