Here is how one can define a port with such a range: struct { static consteval auto name() { return "foobar"; } struct range { float min = -1.; float max = 1.; float init = 0.5; }; float value{};
} foobar; Here is another version which will be picked up too: struct { static consteval auto name() { return "foobar"; } static consteval auto range() { struct { float min = -1.; float max = 1.; float init = 0.5; } r; return r; }; float value{};
} foobar; More generally, in most cases, Avendish will try to make sense of the things the author declares, whether they are types, variables or functions. This is not implemented entirely consistently yet, but it is a goal of the library in order to enable various coding styles and as much freedom of expression as possible for the media processor developer.

