If we modify our example processor this way: struct MyProcessor
{ static consteval auto name() { return "Addition"; } struct { struct { static consteval auto name() { return "a"; } struct range { float min = -10.; float max = 10.; float init = 0.; }; float value; } a; struct { static consteval auto name() { return "b"; } struct range { float min = -1.; float max = 1.; float init = 0.; }; float value; } b; } inputs; struct { struct { static consteval auto name() { return "out"; } float value; } out; } outputs; void operator()() { outputs.out.value = inputs.a.value + inputs.b.value; }
}; then some backends will start to be able to do interesting things, like showing relevant UI widgets, or clamping the inputs / outputs. This is not possible in all back-ends, sadly. Consider for instance PureData: the way one adds a port is by passing a pointer to a floating-point value to Pd, which will write directly the inbound value at the memory address: there is no point at which we could plug-in to perform clamping of the value. Two alternatives would be possible in this case: Change the back-end to instead expect all messages on the first inlet, as those can be captured. This would certainly yield lower performance as one now would have to pass a symbol indicating the parameter so that the object knows to which port the input should map. Implement an abstraction layer which would duplicate the parameters with their clamped version, and perform the clamping on all parameters whenever the process function gets called. This would however be hurtful in terms of performance and memory use.

