Here is a minimal, self-contained definition of an Avendish processor, which works on 2022 compilers: #pragma once
#include <cstdio> struct MyProcessor
{ static consteval auto name() { return "Hello World"; } void operator()() { printf("Henlo\n"); }
}; Yes, it's not much. You may even already have some in your codebase without even being aware of it ! Now, you may be used to the usual APIs for making audio plug-ins and start wondering about all the things you are used too and that are missing here: Inheritance or shelving function pointers in a C struct. Libraries: defining an Avendish processor does not in itself require including anything. A central point of the system is that everything can be defined through bare C++ constructs, without requiring the user to import types from a library. A library of helpers is nonetheless provided, to simplify some repetitive cases, but is in no way mandatory ; if anything, I encourage anyone to try to make different helper APIs that fit different coding styles. Functions to process audio such as void process(double** inputs, double** outpus, int frames); We'll see how all the usual amenities can be built on top of this and simple C++ constructs such as variables, methods and structures.

