// This line is used to instruct the compiler to not include a header file multiple times.
#pragma once // This line is used to allow our program to use `printf`:
#include <cstdio> // This line declares a struct named HelloWorld. A struct can contain functions, variables, etc.
// It could also be a class - in C++, there is no strong semantic difference between either.
struct MyProcessor
{ // This line declares a function that will return a visible name to show to our // users. // - static is used so that an instance of HelloWorld is not needed: // we can just refer to the function as HelloWorld::name(); // - consteval is used to enforce that the function can be called at compile-time, // which may enable optimizations in the backends that will generate plug-ins. // - auto because it does not matter much here, we know that this is a string :-) static consteval auto name() { return "Hello World"; } // This line declares a special function that will allow our processor to be executed as follows: // // HelloWorld the_processor; // the_processor(); // // ^ the second line will call the "operator()" function. void operator()() { // This one should hopefully be obvious :-) printf("Henlo\n"); }
};
